Le Collège cardinalice ou Collège des cardinaux se compose de l'ensemble des cardinaux de l'Église catholique. Créés à la discrétion du pape lors de consistoires ordinaires, les cardinaux reçoivent un titre ou une diaconie qui fait d'eux des membres du clergé du diocèse de Rome, diocèse du pape. Selon le droit canon, leur rôle est d’élire le pape en cas de vacance du siège apostolique, mais aussi celui d’assister le souverain pontife collégialement ou individuellement. Depuis le 17 décembre 2022, date du décès du cardinal Severino Poletto, le Collège cardinalice compte 224 cardinaux, dont : 
* 126 cardinaux électeurs ; 
* 98 cardinaux non votants.
